import styled from "styled-components";
import { Formik, Field, Form} from "formik"
import { TextField, Button, Checkbox } from "@material-ui/core";

const TestWrapper = styled.div`
  width:100%;
  height:100%;
  display:flex;
  flex-flow: row wrap;
`;

interface Props { 

}

const Test = ({  }:Props):JSX.Element=> {

  return (
    <TestWrapper>
      <Formik initialValues={{ text: "", isbool:false, checks:[] }} onSubmit={(data, { setSubmitting }) => {
              setSubmitting(true) 
        console.log(data)


              setSubmitting(false) 
            }}>

            { 
                ({ isSubmitting }) => (
                <Form> 
                      <div>
                        <Field name="text" as={TextField} /> 
                    </div>
                    <div>
                        <Field name="isbool" as={Checkbox} />  
                    </div>
                    <div>
                      <Field name="checks" as={Checkbox} value="React" />
                      <Field name="checks" as={Checkbox} value="Redux" />
                      <Field name="checks" as={Checkbox} value="Webpack" />
                      <Field name="checks" as={Checkbox} value="Typescript" />
                    </div>
                    <div>
                      <Field name="nation" value="Korea" type="radio" /> 
                      <Field name="nation" value="Japan" type="radio" />
                      <Field name="nation" value="China" type="radio" />
                    </div>

                      <Button type="submit" disabled={isSubmitting}>Submit</Button>
                </Form>
                ) 
              }

            </Formik>
    </TestWrapper>
  )

}

export default Test;
